ous l\\u2019enseigne \\u00ab Beforebar.com \\u00bb\\r\\n\\t<br>\\r\\n\\tCapital social : 8.000 \\u20ac<br>\\r\\n\\tSi\\u00e8ge social : 97 bis rue de Jouffroy d\\u2019Abbans 75017 Paris France<br>\\r\\n\\tNum\\u00e9ro d\\u2019identification : 529 779 126 RCS Paris<br>\\r\\n\\tN\\u00b0 TVA : FR 53 529 779 126\\r\\n<\\/p><p><strong>PUBLICATION<\\/strong><br>\\r\\n\\tDirecteur de la publication : Yael KOSKAS<br>\\r\\n\\tT\\u00e9l\\u00e9phone : 01 77 19 12 22 (du mardi au samedi, de 10 h \\u00e0 19h30)\\r\\n<\\/p><p><strong>CR\\u00c9DITS PHOTOS<\\/strong><br>\\r\\n\\tDroit de propri\\u00e9t\\u00e9 sur les visuels : BEFORE BEAUTY BAR\\r\\n<\\/p><p><strong>H\\u00c9BERGEUR<\\/strong><br>\\r\\n\\t<a href=\\\"https:\\/\\/www.ovh.com\\/fr\\/\\\" target=\\\"_blank\\\">OVH<\\/a>, 2 rue de Kellermann \\u2013 BP 80157 ROUBAIX\\r\\n<\\/p>\",\"66\":\"Mentions L\\u00e9gales\",\"57\":\"Nous Contacter\",\"70\":\"Contactez-nous\",\"112\":[\"28\"],\"111\":[\"27\"],\"41\":\"<p class=\\\"norm\\\">La Before Team se d\\u00e9place chez vous ou dans le lieu de votre choix ! Nos Before Artists sont \\u00e0 vos c\\u00f4t\\u00e9s pour vous conseiller et vous sublimer lors de tous vos \\u00e9v\\u00e9nements.\\r\\n<\\/p>\",\"106\":[\"25\"],\"42\":\"\\u00c0 DOMICILE\",\"6\":\"Pro\",\"45\":\"En savoir plus\",\"121\":\"Je privatise\",\"122\":\"Voir les formules\",\"43\":\"<p class=\\\"norm\\\">Privatisez l\'un de nos salons design & girly pour toutes vos occasions entre filles : EVJF, baby shower, anniversaire\\u2026 Pour  un moment unique et inoubliable rien qu\\u2019entre vous.<\\/p>\",\"105\":[\"24\"],\"119\":\"javascript:b4_bar.choose_select(1)\",\"120\":\"https:\\/\\/app.flexybeauty.com\\/before-16\\/category\\/6250230219538432\",\"44\":\"Before Events\",\"30\":\"<p class=\\\"offer-desc\\\">\\r\\n\\tPour \\u00eatre belle des pieds \\u00e0 la t\\u00eate pour vos vacances<br><br><br>\\r\\n\\t+ Beaut\\u00e9 mains, pieds, et pose de vernis<br><br>\\r\\n\\t+ Beaut\\u00e9 mains, pieds, et vernis semi-permanent<br><br>\\r\\n\\t+ Beaut\\u00e9 mains, pieds, vernis, maillot br\\u00e9silien, et jambes compl\\u00e8tes<br><br>\\r\\n\\t+ Beaut\\u00e9 mains, pieds, vernis, maillot br\\u00e9silien, demi-jambes, et aisselles<br><br>\\r\\n\\t...\\r\\n<\\/p>\",\"29\":\"Pour \\u00eatre belle des pieds \\u00e0 la t\\u00eate pour vos vacances\",\"31\":\"A partir de 52\\u20ac \\/ personne\",\"28\":\"The Beach\",\"21\":\"<p class=\\\"offer-desc\\\">        \\r\\n\\tAvant un RDV professionnel ou amoureux\\r\\n\\t<br><br><br>\\t\\r\\n\\t+ Brushing ou coiffure d\'un soir\\r\\n\\t<br><br>\\r\\n\\t+ Maquillage<br><br>\\r\\n\\t+ Beaut\\u00e9 mains avec pose de vernis\\r\\n<\\/p>\",\"22\":\"Avant un RDV professionnel ou amoureux\",\"23\":\"A partir de 42\\u20ac \\/ personne\",\"20\":\"Dating & Party\",\"18\":\"<p class=\\\"offer-desc\\\">Pour toutes vos occasions entre filles<br><br><br>\\r\\n\\t+ Vernis semi-permanent<br><br>\\r\\n\\t+ Beaut\\u00e9 des mains & des pieds<br><br>\\r\\n\\t+ Atelier make-up entre filles<br><br>\\r\\n\\t...\\r\\n<\\/p>\",\"17\":\"Privatisez pour tous vos events (EVJF, baby shower\\u2026)\",\"19\":\"A partir de 40\\u20ac \\/ personne\",\"16\":\"Events\",\"26\":\"<p class=\\\"offer-desc\\\">\\r\\n\\tPour \\u00eatre au top le plus beau jour de votre vie<br><br><br>\\r\\n\\t+ Essai maquillage ou coiffure<br><br>\\r\\n\\t+ Maquillage et coiffure du Jour J<br><br>\\r\\n\\t+ Formule compl\\u00e8te sur 8 jours jusqu\\u2019au mariage<br><br>\\r\\n\\t...\\r\\n<\\/p>\",\"25\":\"Pour \\u00eatre au top le plus beau jour de votre vie\",\"27\":\"A partir de 100\\u20ac\",\"24\":\"Wedding\",\"3\":\"Forfaits\",\"15\":\"D\\u00e9couvrir le forfait\",\"14\":\"<p class=\\\"norm\\\">Before Beauty Bar est le premier bar \\u00e0 beaut\\u00e9 avant \\u00e9v\\u00e9nements.<br>\\r\\n\\tDans l\'air du temps, son concept associe un forfait beaut\\u00e9 rapide et accessible \\u00e0 chaque occasion de la vie d\'une femme.<br>D\\u00e9couvrez ci-dessous nos 4 forfaits stars. Pour celles qui ne trouvent pas leur bonheur,<br>\\r\\n\\tBefore propose aussi des <a href=\\\"#soins\\\">prestations \\u00e0 la carte<\\/a>.\\r\\n<\\/p>\",\"13\":\"Les forfaits Before\",\"12\":\"Prendre rendez-vous\",\"11\":\"Before Beauty Bar vous sublime avant chaque \\u00e9v\\u00e9nement\",\"10\":\"Cr\\u00e9ateur de beaut\\u00e9\",\"7\":\"Presse\",\"50\":\"Voir nos parutions\",\"49\":\"<p class=\\\"norm\\\">On parle de nous dans la presse ! Parce que les petits mots \\u00e9logieux font toujours plaisir, vous pouvez retrouver tous les billets sur le salon et son actualit\\u00e9.\\r\\n<\\/p>\",\"48\":\"Presse\",\"5\":\"Events\",\"118\":\"Contactez-nous\",\"46\":\"<p><br><\\/p><p>Parce que Before est aussi une conciergerie beaut\\u00e9 de luxe, nous vous accompagnons dans vos \\u00e9v\\u00e9nements professionnels avec nos formules d\\u2019animations beaut\\u00e9 pour les entreprises : Nail bar, maquillage, bar \\u00e0 tresses, bar \\u00e0 brushing...\\r\\n<\\/p>\",\"47\":\"Espace Pro\",\"117\":\"Nos salons\",\"8\":\"Social\",\"52\":\"Ne ratez plus aucune actu before !\",\"54\":\"Facebook\",\"55\":\"https:\\/\\/www.facebook.com\\/Beforebeautybar\",\"53\":\"Insta\",\"56\":\"https:\\/\\/instagram.com\\/beforebeautybar\\/\",\"51\":\"We are Social\",\"4\":\"\\u00c0 la carte\",\"34\":\"<p class=\\\"contentpop\\\">Nos professionnels vous accueilllent et mettent leur expertise \\u00e0 votre service. El\\u00e9gant, l\\u00e9ger ou \\u00e9lectrique : tous les styles sont permis !<br>\\r\\n\\tA partir de 20\\u20ac\\r\\n<\\/p>\",\"32\":\"Bar \\u00e0 coiffure\",\"38\":\"<p class=\\\"contentpop\\\">Quelle que soit l\\u2019occasion, votre visage est au centre de nos attentions. A travers les teintes et les textures, faites-vous chouchouter selon vos envies !<br>\\r\\n\\tA partir de 25\\u20ac\\r\\n<\\/p>\",\"37\":\"Bar \\u00e0 maquillage\",\"36\":\"<p class=\\\"contentpop\\\">Profitez d\\u2019un savoir-faire unique pour \\u00eatre belle jusqu\\u2019au bout des ongles ! Une touche de vernis sublimera vos pieds et mains \\u00e0 merveille.<br>\\r\\n\\tA partir de 10\\u20ac\\r\\n<\\/p>\",\"35\":\"Bar \\u00e0 ongles\",\"40\":\"<p class=\\\"contentpop\\\">Prenez un moment de d\\u00e9tente pour vous ressourcer et \\u00e9nergiser votre peau. Nos soins sont vari\\u00e9s et complets pour une sensation durable de fra\\u00eecheur.<br>\\r\\nA partir de 35\\u20ac\\r\\n<\\/p>\",\"39\":\"Spa urbain\",\"33\":\"Soins \\u00e0 la carte\",\"74\":\"<p><a href=\\\"https:\\/\\/www.google.fr\\/maps\\/place\\/97+Rue+Jouffroy+d\'Abbans,+75017+Paris\\/@48.8820013,2.3019859,17z\\/data=!3m1!4b1!4m2!3m1!1s0x47e66fbe06b14afb:0xc4b10c0280c53462?hl=fr\\\" target=\\\"_blank\\\">97 bis rue Jouffroy d\'Abbans<br>75017 Paris<\\/a>\\r\\n<\\/p>\",\"73\":\"<p><a href=\\\"tel:0177191222\\\">01 77 19 12 22<\\/a>\\r\\n<\\/p>\",\"72\":\"<p>Du mardi au samedi<br>\\r\\n\\tde 10h00 \\u00e0 19h30<\\/p>\",\"87\":\"https:\\/\\/app.flexybeauty.com\\/before\\/home\",\"71\":\"Before 17e\",\"76\":\"<p><a href=\\\"https:\\/\\/www.google.fr\\/maps\\/place\\/74+Rue+Saint-Didier,+75116+Paris\\/@48.8677807,2.2817583,17z\\/data=!3m1!4b1!4m2!3m1!1s0x47e66ff763bf95c1:0xf461b396e5344ba4?hl=fr\\\" target=\\\"_blank\\\">74 rue Saint-Didier<br>75016 Paris<\\/a>\\r\\n<\\/p>\",\"78\":\"<p><a href=\\\"tel:0142562648\\\">01 42 56 26 48<\\/a>\\r\\n<\\/p>\",\"77\":\"<p>Du mardi au samedi<br>\\r\\n\\tde 10h00 \\u00e0 19h30<\\/p>\",\"88\":\"https:\\/\\/app.flexybeauty.com\\/before-16\\/home\",\"75\":\"Before 16e\"}}', '2016-02-16 10:44:14', '2016-02-16 10:44:14', '0d8836fa-d4ea-43ea-bb9a-75eb11afb5f7'),
